        if i - 1 in freq and freq[i - 1] > 0:
            unique_weights[i] = 1
            freq[i - 1] -= 1
            continue
        if i in freq and freq[i] > 0:
            unique_weights[i] = 1
            freq[i] -= 1
            continue
        if i + 1 in freq and freq[i + -1] > 0:
            unique_weights[i] = 1
            freq[i + 1] -= 1
            continue
    return sum(unique_weights)
